import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import Cards from "./Project1/Cards";
import sData from  './Project1/cardLists';

const newFunc =  (val)=>{
    return (
            <Cards key={val.id} srcImage={val.srcImage} title={val.title} typeTrend={val.typeTrend}></Cards>
    )
}
var root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <React.Fragment>
    <h1 className='heading1'>Top Five MxPlayer Series</h1>
    {sData.map(newFunc)}
    </React.Fragment>

);
